import React from 'react';
import Countdown from './Countdown';
import '../../styles/css/DisplayCountdown.css';
import mapFight from '../../styles/assets/bombayFit.jpg';

class Display extends React.Component {
  render() {
    return (
      <div className="fightZone">
        <Countdown val={60} />
        <img className="fightBackGround" src={mapFight} alt="fight zone" />
      </div>
    );
  }
}

export default Display;
